import React, { Component } from 'react';
import { compileFunction } from 'vm';

class Todos extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'do the dishes',
        completed: false
      },
      {
        id: 3,
        title: 'walk the dog',
        completed: false
      }
    ]
  }

  render() {
    return (
      <div>
        <h1>Todos</h1>
      </div>
    );
  }
}

export default Todos;
